			tmp10 = ((z12 * this.FIX_1_082392200) >> 8) - z5; // 2*(c2-c6)
			tmp12 = ((z10 * -this.FIX_2_613125930)	>> 8 ) + z5; // -2*(c2+c6)

			tmp6 = tmp12 - tmp7; // phase 2
			tmp5 = tmp11 - tmp6;
